          showCancelButton: true,
          cancelButtonText: 'No, cancelar!',
          confirmButtonText: 'Si, anular la factura!',
          reverseButtons: false
        }).then((result) => {
          if (result.isConfirmed) {
            Swal.fire(
              'Eliminado!',
              'Tu factura se ha anulado.',
              'success'
            ).then( okay=> {
                if(okay){
                    document.getElementById('btnAnular').click();
                }
